import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  defaultContainerStyle: {
    alignItems: "center",
    justifyContent: "center",
  },
  defaultContentStyle: {
    alignItems: "center",
    backgroundColor: "white",
    height: 400,
    justifyContent: "center",
    padding: 25,
    width: 300,
  },
  iconStyle: {
    height: 128,
    marginBottom: 40,
    width: 128,
  },
  textStyle: {
    fontFamily: "Gilroy_Medium",
    fontSize: 18,
    lineHeight: 24,
    textAlign: "center",
  },
});

export default styles;
